import React, { Component } from "react";

class Presentationlist extends Component {
  render() {
    return (
      <div>
        {this.props.presentation.map(item => {
          return (
            <div>
              <p>Presenter {item.name}</p>
            </div>
          );
        })}
      </div>
    );
  }
}

export default Presentationlist;
